import React, { useState, useEffect } from "react";
import axios from 'axios';
import { useParams } from 'react-router-dom';

import MenuNav from "../Components/MenuNav";

function Order() {
    let { code } = useParams();
    return (
        <div className="order">
            <MenuNav />
            <div className="body">
                <aside>
                    <ul className="asideFilter">
                        <li onClick={() => setPage('')}>Профиль</li>
                        <li onClick={() => setPage('favorites')}>Избранное</li>
                        <li onClick={() => setPage('pets')}>Питомцы</li>
                        <li onClick={() => setPage('orders')}>Заказы</li>
                        {access === 1 &&
                            <li onClick={() => setPage('manage')}>Управление</li>
                        }
                    </ul>
                    <div className="exit">
                        <button onClick={() => deleteAllCookies()}>
                            <img src={exit} />
                            Выйти
                        </button>
                    </div>
                </aside>
        </div>
        </div>
    );
}

export default Order;
